import React, { Component } from "react";

import TableFilters, {
  InputDescriptor,
} from "../../components/QueryView/TableFilters/TableFilters";
type Props = {};

const Services: React.FC<Props> = ({}) => {
  const elements = [
    { name: "id", type: "text", placeholder: "Id" },
    {
      name: "numero_documento",
      type: "text",
      placeholder: "Numero de documento",
    },
    { name: "primer_nombre", type: "text", placeholder: "Primer nombre" },
    { name: "primer_apellido", type: "text", placeholder: "Primer apellido" },
    { name: "fecha_inicio", type: "date", placeholder: "Fecha inicio" },
    { name: "fecha_fin", type: "date", placeholder: "Fecha fin" },
  ];
  return (
    <>
      <div className="container-fluid">
        <h1>
          Consulta <small>Facturas</small>
        </h1>
        <div className="row">
          <TableFilters elements={elements} />
          <div className="col-10">
            <div className="container-fluid">
              <div className="table-responsive">CustomTable</div>
            </div>

            <div className="container">
              <div>TablePaginator</div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Services;
